export function login(usuario){

  var url = 'http://localhost:5000/inicio'
  var datos = {
  email: usuario.email,
  password: usuario.password
};

  fetch( url , {
    method: 'POST',
    header: JSON.stringify({ datos }),
    headers: {
      'Content-Type':'application/json'
    }
  });
}
